import { createMuiTheme }  from '@material-ui/core/styles'
import getMuiTheme from '@material-ui/styles/getMuiTheme';
import baseTheme from '@material-ui/styles';
import * as Colors from '@material-ui/styles/colors';
import { fade } from '@material-ui/utils/colorManipulator'

const theme = () => {
  let overwrites = {
    "palette": {
        "canvasColor": Colors.grey900,
        "primary1Color": Colors.grey200,
        "primary2Color": Colors.amber700,
        "primary3Color": Colors.blueGrey600,
        "accent1Color": Colors.deepOrangeA200,
        "accent2Color": Colors.deepOrangeA200,
        "accent3Color": Colors.deepOrange200
    }
};
  return theme(baseTheme, overwrites);
}

export default theme
